// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import HeroSection from './components/HeroSection';
import Search from './components/Search';
import './App.css';


const App = () => {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <HeroSection/>
        {/* <div className="search-sections">
          <Search type="Fund" />
          <Search type="Company" />
        </div> */}
        <Routes>
          <Route path="/about-us" component={() => <div>About Us Page</div>} />
          <Route path="/search-companies" component={() => <Search type="Company" />} />
          <Route path="/search-funds" component={() => <Search type="Fund" />} />
          <Route path="/sell-overpaid-ceo" component={() => <div>Sell the Overpaid CEO Virtual Portfolio Page</div>} />
          <Route path="/" component={HeroSection} />
        </Routes>
      </div>
      <Search/>
    </Router>
  );
};

export default App;
